// ==UserScript==
// @name          Yae Miko fox form progress bar
// @namespace     http://userstyles.org
// @description	  Yae Miko fox form progress bar (Genshin Impact inspired)
// @author        Jess
// @include       http://youtube.com/*
// @include       https://youtube.com/*
// @include       http://*.youtube.com/*
// @include       https://*.youtube.com/*
// @run-at        document-start
// @version       0.257788
// @license MIT
// @downloadURL https://update.greasyfork.org/scripts/457220/Yae%20Miko%20fox%20form%20progress%20bar.user.js
// @updateURL https://update.greasyfork.org/scripts/457220/Yae%20Miko%20fox%20form%20progress%20bar.meta.js
// ==/UserScript==
(function() {var css = [
	"/* Video progress bar */",
	".html5-play-progress,",
	".ytp-play-progress,.ytp-clip-start-exclude {",
	"   background: url(\"data:image/png;base64,\") repeat-x !important; ",
	"background: linear-gradient(to bottom, #FF0000 0%, #FF0000 16.5%, #FF9900 16.5%, #FF9900 33%, #FFFF00 33%, #FFFF00 50%, #33FF00 50%, #33FF00 66%, #0099FF 66%, #0099FF 83.5%, #6633ff 83.5%, #6633ff 100%) !important;",
	"background: -webkit-linear-gradient(top, #FF0000 0%, #FF0000 16.5%, #FF9900 16.5%, #FF9900 33%, #FFFF00 33%, #FFFF00 50%, #33FF00 50%, #33FF00 66%, #0099FF 66%, #0099FF 83.5%, #6633ff 83.5%, #6633ff 100%) !important;",
	"background: -moz-linear-gradient(top, #FF0000 0%, #FF0000 16.5%, #FF9900 16.5%, #FF9900 33%, #FFFF00 33%, #FFFF00 50%, #33FF00 50%, #33FF00 66%, #0099FF 66%, #0099FF 83.5%, #6633ff 83.5%, #6633ff 100%) !important;",
	"/*None*/",
	"}",
    "/* Video load bar */",
	".html5-load-progress,",
	".ytp-load-progress {",
	"    background:  url(\"data:image/gif;base64,\") !important;",
	"    opacity:0.89;",
	"    /*None*/",
	"}",
	"  .ytp-scrubber-button",
	"  {",
	"    background: url(\"https://cdn.discordapp.com/attachments/1035493300968366101/1041354514705436724/IMG_3914.GIF\")! important;",
	"    background-repeat: no-repeat! important;",
	"    width: 800px! important;",
	"    height: 600px! important;",
	"    margin-left: -420px! important;",
	"    margin-top: -329px! important;",
	"    transform: scale(0.13)! important;",
	"  }"
].join("\n");
if (typeof GM_addStyle != "undefined") {
	GM_addStyle(css);
} else if (typeof PRO_addStyle != "undefined") {
	PRO_addStyle(css);
} else if (typeof addStyle != "undefined") {
	addStyle(css);
} else {
	var node = document.createElement("style");
	node.type = "text/css";
	node.appendChild(document.createTextNode(css));
	var heads = document.getElementsByTagName("head");
	if (heads.length > 0) {
		heads[0].appendChild(node);
	} else {
		// no head yet, stick it whereever
		document.documentElement.appendChild(node);
	}
}
})();
